actionConfiguration.body:
() =>{		
		if(CreateNewGsheet_CMCs.data.webViewLink != null){
			showAlert('Test')
			navigateTo(CreateNewGsheet_CMCs.data.webViewLink,{},'NEW_WINDOW');
		}
		else {
			CreateNewGsheet_CMCs.run(
				// success
				() => {storeValue('Key_URLCreateCMCs', CreateNewGsheet_CMCs.data.webViewLink);
							 navigateTo(CreateNewGsheet_CMCs.data.webViewLink,{},'NEW_WINDOW');},
				//fail
				() => {storeValue('Key_URLCreateCMCs', '');showAlert("Something wrong happened - Can't create GSheet");}
			)
		}
	}

